import React from 'react';
import Header from '../Header/Header';

const Home = () => {
  return (
    <>
      <Header />

      <div className="maindiv" style={{ backgroundImage: `url(${process.env.PUBLIC_URL}/C.jpeg)`, height: '600px', width: '100%', marginTop: '-19px' }}>
        <h3>Welcome to my website!</h3>
        <p>This is the content of the maindiv.</p>
      </div>

      {/* The rest of your app */}
    </>
  );
};

export default Home;
